# Sikar, Republic of Dagestan

}}
Sikar (; ) is a rural locality (a selo) in Khadiyalsky Selsoviet, Tlyaratinsky District, Republic of Dagestan, Russia. Population:  There are 2 streets.
Geography
Sikar is located 13&nbsp;km southeast of Tlyarata (the district's administrative centre) by road. Nikar is the nearest rural locality.
